import React from "react";
import "./Row.css";

export default function Row(props) {
  props.books.map((book) => {
    return (
      <div className="row">
        <div className="title">{book.title}</div>
        <div className="author">{book.author}</div>
        <div className="pages">{book.pages}</div>
      </div>
    );
  });
}
